/**
 * @param {string} s
 * @param {string} t
 * @return {string}
 */
var minWindow = function (source, target) {
    //目标字符串转map
    if (source.length < target.length) return "";
    let tMap = new Map();
    for (let i = 0; i < target.length; i++) {
        let _char = target[i];
        let val = tMap.has(_char) ? tMap.get(_char) + 1 : 1;
        tMap.set(_char, val);
    }
    let left = 0, right = 0;
    let len = source.length
    let minlen = len + 1;
    let res = "";
    while (left < len) {
        if (tMap.has(source[left])) {
            let rMap = new Map();
            let count = 0;
            right = left;
            while (right < len) {
                let rightChar = source[right];
                if (tMap.has(rightChar)) {
                    if (rMap.has(rightChar)) {
                        let val = rMap.get(rightChar) + 1;
                        if (tMap.get(rightChar) >= val) {
                            rMap.set(rightChar, val);
                            ++count
                        }
                    }
                    else {
                        rMap.set(rightChar, 1)
                        ++count
                    }
                    if (count == target.length) {
                        let resStr = source.slice(left, right + 1);
                        res = minlen > resStr.length ? resStr : res;
                        minlen = res.length;
                        right = len;
                    }
                }
                right++;
            }
        }
        left++;
        if (res.length == target.length && target.length > len - left - 1) break;
    }
    return res;
};

console.log(minWindow("babb", "baba"));
console.log(minWindow("aaaaaaaaaaaabbbbbcdd", "abcdd"));
